//Procedimento que recebe duas variveis, uma que aponta para
//um array e outra que aponta para um inteiro com a posio do
//array a ser usada. O procedimento termina quando atinge a
//primeira posio depois dos parnteses.
void casa_parenteses(char* array1, int* p) {
    int paren = 1;
    int c = *p;
    while (paren != 0) {
        switch (array1[c]) {
            case '(':
                paren++;
                c++;
                break;
            case ')':
                paren--;
                c++;
                break;
            default:
                c++;
        }
    }
    *p = c;
}

Celula *cria_combinador(char *entrada){
	Celula *combinador;
	combinador = malloc( sizeof(Celula) );
	combinador->tipo = entrada[0];
	combinador->fdir = NULL;
	combinador->fesq = NULL;
	return combinador;
}

Celula *cria_aplicacao(){
	Celula *aplicacao;
	aplicacao = malloc(sizeof(Celula));
	aplicacao->tipo = '@';
	aplicacao->fdir = NULL;
	aplicacao->fesq = NULL;
	return aplicacao;
}


/*Procedimento pega a string de entrada e a partir da mesma cria o grafo
 * fazendo uma busca em ordem de baixo para cima
 * */
Celula* cria_grafo(char *entrada){

	Celula *raiz = cria_aplicacao();

	while(entrada[0] != '\0'){

			if(entrada[0] == ')'){
					return raiz;
			}
			else if(entrada[0] == '('){
				Celula *ap = cria_aplicacao();
				Celula *aux = raiz;
				ap->fesq = aux;
				ap->fdir = cria_grafo(entrada + 1);
				raiz = ap;
				int end   = 1;
				casa_parenteses(entrada,&end);
				for(int i = 0; i < end; i++){
					entrada++;
				}
			}
			else{
				if(raiz->fesq == NULL){
					Celula *comb = cria_combinador(entrada);
					raiz->fesq = comb;
					entrada++;
				}
				else if(raiz->fdir == NULL){
					Celula *comb = cria_combinador(entrada);
					raiz->fdir = comb;
					entrada++;
				}
				else{
					Celula *ap = cria_aplicacao();
					Celula *aux  = raiz;
					ap->fesq  = aux;
					raiz  = ap;
				}
			}
	}

	return raiz;
}

/*Procedimento dedicado a impresso do grado no console
 * para verificar se o grafo criado est correto.
 * */
void imprime_grafo(Celula *cel){

	if(cel->tipo != '@'){
		printf("%c",cel->tipo);
	}
	else{
		if(cel->fesq != NULL){
			imprime_grafo(cel->fesq);
		}
		if(cel->fdir != NULL){
			if(cel->fdir->tipo == '@'){
				printf("(");
				imprime_grafo(cel->fdir);
				printf(")");
			}
			else{
				imprime_grafo(cel->fdir);
			}
		}
	}
}

int main(){

	Celula *grafo = cria_grafo(string);

	imprime_grafo(grafo);



	return 0;
}
